import React from 'react'
// import HomeApp from './components/Homebox/Home/home';
import './index.css';
import Home from '../../../Homebox/homeBox'
import OrderBoxNav from '../../../OrderBox/orderBox'
import ServicesNav from '../../../Services/servicesNav'
import ShopNav from './components/Shop/shopNav';
// import ShopNav from '../../../Shop/shopNav'

function App() {
  return (
    <div>
      <Router>
                    <Switch>
                        <Route path="/" exact component={Home}></Route>
                        <Route path="/WorkOut" component={FeaturesNav}></Route>
                        <Route path="/Diet" component={ShopNav}></Route>
                        <Route path="/connect" component={OrderBoxNav}></Route>
                        <Route path="/connect" component={ServicesNav}></Route>

                    </Switch>
            </Router>

      {/* <HomeApp/> */}
    </div>
  );
}

export default App;
